{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/seifhkungulio/neural-network-classification?scriptVersionId=215372327\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"4bf78e13","metadata":{"papermill":{"duration":0.009379,"end_time":"2024-12-30T05:55:27.873818","exception":false,"start_time":"2024-12-30T05:55:27.864439","status":"completed"},"tags":[]},"source":["# **Neural Networks Classification**"]},{"cell_type":"markdown","id":"9546bc2e","metadata":{"papermill":{"duration":0.008307,"end_time":"2024-12-30T05:55:27.89127","exception":false,"start_time":"2024-12-30T05:55:27.882963","status":"completed"},"tags":[]},"source":["## **Business Understanding**\n","\n","\n","### **Problem Statement**\n","In this case study, the main goal is to predict whether a stock will pay a dividend. Dividends represent a portion of a company's earnings distributed to shareholders, which serve as an indicator of financial stability and management confidence. This prediction helps investors assess potential returns and evaluate the company’s financial health.\n","\n","### **Main Objective**\n","The objective is to leverage neural network models to predict dividend payments of stocks effectively. The focus is on using advanced machine learning techniques to capture complex relationships in the financial data, which can help investors, analysts, and financial institutions make informed decisions regarding investment portfolios. By analyzing historical data on company earnings, financial metrics, market conditions, and industry trends, the model aims to provide accurate forecasts of future dividend payments, thereby enhancing strategic investment planning and portfolio management."]},{"cell_type":"markdown","id":"aaae1ee5","metadata":{"papermill":{"duration":0.008739,"end_time":"2024-12-30T05:55:27.908576","exception":false,"start_time":"2024-12-30T05:55:27.899837","status":"completed"},"tags":[]},"source":["## **Data Understanding**\n","\n","### Review the Dataset\n","The dataset contains six(6) variables on 200 stocks. Each row represents information on a different stock. The first column \"dividend\" is the outcome variable in data mining. The data indicated if a stock had a dividend (Yes = 1; No = 0).\n","\n","### Data Dictionary\n","\n","| Attribute            | Definition                                              |  Data Type        | Constraints/ Rules |\n","|:---------------------|:--------------------------------------------------------|:------------------|:-------------------|\n","| **dividend** | A portion of a company's earnings is ditributed to shareholders as a return on their investment | Integer | It must be a non-negative integer. |\n","| **fcfps** | Free Cash Flow Per Share (fcfps) - A measure of a company's ability to generate cash after accounting for capital expenditures, calculated by dividing free cash flow by the number of outstanding shares. | Numeric | It must be numeric. |\n","| **earning_growth** | The percentage increase or decrease in a company's earnings over a specific period indicates financial performance and future profitability. | Numeric | It must be numeric. |\n","| **de** | Debt-to-Equity Ratio (DE) - A financial metric that compares a company's total debt to its shareholders' equity, indicating the proportion of debt used to finance its operations relative to equity. | Numeric | It must be numeric. |\n","| **mcap** | Market Capitalization (MCAP) - The total value of a company's outstanding shares, calculated by multiplying the current share price by the total number of shares outstanding. | Integer | It must be a non-negative integer. |\n","| **current_ratio** | A liquidity ratio that measures a company's ability to pay its short-term liabilities with its short-term assets, calculated by dividing current assets by current liabilities. | Numeric | It must be numeric. |"]},{"cell_type":"markdown","id":"e903348d","metadata":{"papermill":{"duration":0.00912,"end_time":"2024-12-30T05:55:27.926707","exception":false,"start_time":"2024-12-30T05:55:27.917587","status":"completed"},"tags":[]},"source":["## **Data Preparation**"]},{"cell_type":"code","execution_count":1,"id":"be065768","metadata":{"execution":{"iopub.execute_input":"2024-12-30T05:55:27.948966Z","iopub.status.busy":"2024-12-30T05:55:27.946761Z","iopub.status.idle":"2024-12-30T05:55:28.119988Z","shell.execute_reply":"2024-12-30T05:55:28.118015Z"},"papermill":{"duration":0.186941,"end_time":"2024-12-30T05:55:28.122495","exception":false,"start_time":"2024-12-30T05:55:27.935554","status":"completed"},"tags":[]},"outputs":[],"source":["dividend.df <- read.csv(\"../input/case-studies/dividend_info.csv\")"]},{"cell_type":"code","execution_count":2,"id":"aeb044fa","metadata":{"execution":{"iopub.execute_input":"2024-12-30T05:55:28.173867Z","iopub.status.busy":"2024-12-30T05:55:28.141288Z","iopub.status.idle":"2024-12-30T05:55:28.201977Z","shell.execute_reply":"2024-12-30T05:55:28.199455Z"},"papermill":{"duration":0.074524,"end_time":"2024-12-30T05:55:28.205398","exception":false,"start_time":"2024-12-30T05:55:28.130874","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li>200</li><li>6</li></ol>\n"],"text/latex":["\\begin{enumerate*}\n","\\item 200\n","\\item 6\n","\\end{enumerate*}\n"],"text/markdown":["1. 200\n","2. 6\n","\n","\n"],"text/plain":["[1] 200   6"]},"metadata":{},"output_type":"display_data"}],"source":["# Check the dimensions of the data frame\n","dim(dividend.df)"]},{"cell_type":"code","execution_count":3,"id":"7cbc129a","metadata":{"execution":{"iopub.execute_input":"2024-12-30T05:55: