e cost of false negatives is high.\n","* **Precision:** Precision measures the proportion of true positive cases among all predicted positive cases. It represents the model's accuracy in predicting positive cases. Precision is instrumental when the cost of false positives is high.\n","* **F1-Score:** The F1-score is the harmonic mean of precision and recall (sensitivity). It provides a balanced measure of the model's performance, especially in the presence of class imbalance.\n","* **Receiver Operating Characteristic (ROC) Curve:** The ROC curve represents the trade-off between sensitivity and specificity across different thresholds. The area under the ROC curve (AUC-ROC) is a commonly used metric that quantifies the model's overall performance, with higher values indicating better discrimination ability."]},{"cell_type":"markdown","id":"7d6fa293","metadata":{"papermill":{"duration":0.025944,"end_time":"2024-12-30T05:55:33.380093","exception":false,"start_time":"2024-12-30T05:55:33.354149","status":"completed"},"tags":[]},"source":["### **Accuracy**"]},{"cell_type":"code","execution_count":28,"id":"ddcfcf24","metadata":{"execution":{"iopub.execute_input":"2024-12-30T05:55:33.431321Z","iopub.status.busy":"2024-12-30T05:55:33.429187Z","iopub.status.idle":"2024-12-30T05:55:33.462166Z","shell.execute_reply":"2024-12-30T05:55:33.459657Z"},"papermill":{"duration":0.058272,"end_time":"2024-12-30T05:55:33.465501","exception":false,"start_time":"2024-12-30T05:55:33.407229","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Accuracy: 0.8387097"]}],"source":["# Calculate accuracy\n","# Convert the predicted values to binary classes (0 or 1) based on a threshold\n","predicted_classes <- ifelse(nn.results$net.result > 0.5, 1, 0)\n","# Compute accuracy\n","accuracy <- mean(predicted_classes == testing.data$dividend)\n","cat(\"Accuracy:\", accuracy)"]},{"cell_type":"markdown","id":"e88e679e","metadata":{"papermill":{"duration":0.023956,"en