predicted probabilities for class 1 (dividends)\n","# Convert predicted probabilities to numeric vector\n","predicted_probabilities <- as.numeric(nn.results$net.result)\n","# Compute ROC curve\n","roc_curve <- roc(testing.data$dividend, predicted_probabilities)\n","# Plot ROC curve\n","plot(roc_curve, main = \"ROC Curve\", col = \"blue\")\n","abline(a = 0, b = 1, lty = 2, col = \"red\")  # Diagonal reference line\n","# Calculate AUC\n","auc_score <- auc(roc_curve)\n","cat(\"AUC score:\", auc_score)\n","# Add AUC value to plot\n","text(0.5, 0.5, paste(\"AUC =\", round(auc_score, 4)), adj = c(0.5, 0.5), cex = 1.5, col = \"black\")"]},{"cell_type":"markdown","id":"d28250ae","metadata":{"papermill":{"duration":0.018929,"end_time":"2024-12-30T05:55:34.171198","exception":false,"start_time":"2024-12-30T05:55:34.152269","status":"completed"},"tags":[]},"source":["### **Model Evaluation Summary**\n","The evaluation metrics of the neural network model for predicting stock dividends reveal strong performance:\n","\n","* **Accuracy:** The model achieves an accuracy of approximately 83.87%, highlighting its capability to make correct predictions in the majority of cases.\n","* **Sensitivity (Recall):** A perfect score of 1.000 shows the model's excellence in identifying all positive cases (companies issuing dividends).\n","* **Precision:** At 0.7058824, the model demonstrates a high level of precision but leaves room for improvement to reduce false positives.\n","* **F1-Score:** With an F1-score of 0.8275862, the model strikes a good balance between precision and recall.\n","* **AUC:** The AUC value of 0.9791667 reflects excellent discriminatory power in distinguishing between positive and negative cases.\n","\n","#### **Conclusions**\n","* The model effectively predicts dividend outcomes, excelling in identifying positive cases (sensitivity) and overall classification performance (AUC).\n","* There is an opportunity to enhance precision by refining the architecture and optimizing hyperparameters through backpropagation."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":5741255,"sourceId":9446552,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":9.762542,"end_time":"2024-12-30T05:55:34.31417","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-12-30T05:55:24.551628","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}